import Container from './../Ui/Container'
const Figure = (props) => {
  return(
    <div className='figure--section'>
    <Container>
    <figure className='w-full h-34 border px-2 relative mx-auto mt-14'>
    <img className=' w-full h-full object-cover' src='https://unsplash.it/300/350' alt='meme'/>
    </figure>
    </Container>
    </div>
    )
}
export default Figure;
